INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(187442, 'zhCN', '', '你罪孽无数。但其中最残酷的莫过于纵容你的野兽伤害无辜者。', 37474),
(38124, 'zhCN', '拥抱黑暗吧……永恒的黑暗。', '拥抱黑暗吧……永恒的黑暗。', 37474),
(180366, 'zhCN', '', '很荣幸能迎接你们来到晋升堡垒！虽然你们跟我见过的其它灵魂都不一样。不过没关系。', 37474),
(187280, 'zhCN', '锐眼密院被铲除了，我们的秘密已经安全无虞。现在没人能阻止我们的计划了。', '', 37474),
(185904, 'zhCN', '嫉妒？别扯了。我哪里都比他强！', '', 37474),
(182733, 'zhCN', '知识印记。对抗愚昧与恐惧的道标。', '', 37474),
(180367, 'zhCN', '', '你们将会成为格里恩的一员！我们的神圣职责就是将凡人之魂带给仲裁官进行审判。', 37474),
(194383, 'zhCN', '', '这一定很有意思。', 37474),
(182626, 'zhCN', '', '你准备好了，就靠近火焰。遵循守魂者的指引。', 37474),
(202313, 'zhCN', '', '让我把他们全部消灭！一点渣滓都不留——', 37474),
(202311, 'zhCN', '嗯，我也在想……不如就灭了这些头脑简单四肢发达的生物，让他们为我们的晋升铺路。该怎么做呢，我得想想……', '', 37474),
(202310, 'zhCN', '', '我有个更棒的主意，主宰者！我灭了他们不就好了？', 37474),
(202312, 'zhCN', '', '答应我吧，主宰者！我想要去战斗！', 37474),
(202315, 'zhCN', '我会帮助我们的客人进行赎罪。等他们忏悔之后，你就能消灭他们，让他们的灵魂前往噬渊！', '', 37474),
(205464, 'zhCN', '', '我现在明白为什么你们世界的生物都那么强大了，难怪你们可以击退燃烧军团。我代表炽蓝仙野感谢你的力量。', 37474),
(191962, 'zhCN', '<有文字刻在雕像的底座上。>\n\n通过力量的试炼才能获得尊重。出类拔萃的勇士会得到所有人敬礼。', '', 37474),
(191966, 'zhCN', '<雕像的底座上刻着文字。>\n\n真相或许就隐藏在黑暗之中。技艺高超者可以潜伏在敌人面前。', '', 37474),
(180775, 'zhCN', '必须警告……宗主……', '必须警告……宗主……', 37474),
(193577, 'zhCN', '', '稍停一下。', 37474),
(186290, 'zhCN', '优雅高贵，威力十足。这顶王冠足以守护一个国度。', '', 37474),
(193598, 'zhCN', '', '哼，把你扔哪儿好呢？', 37474),
(193582, 'zhCN', '', '想试试这东西吗？', 37474),
(203409, 'zhCN', '是把武器……托加斯特的烈焰铸造出了一把哀伤的剑刃。', '', 37474),
(196707, 'zhCN', '准备开火！', '', 37474),
(199409, 'zhCN', '你想要我的心能？古老的仙木灵干嘛去了？', '', 37474),
(199444, 'zhCN', '好了。搞定这一切吧！', '', 37474),
(198956, 'zhCN', '我没时间理会这些，$c。女伯爵还在等我呢。', '我没时间理会这些，$c。女伯爵还在等我呢。', 37474),
(206412, 'zhCN', '', '什么风把你吹到玛卓克萨斯来了，$p？\n\n你要为王庭的盛宴收集更多蘑菇？还是需要更多玛卓克萨斯士兵来保卫高墙？\n\n<瓦丝琪女男爵微笑着。>\n\n我得承认，我确实比想象中要更喜欢灰烬王庭。\n\n雷纳索尔王子虽然是表面上的主人，但大多数时间里，我都在关注着你。\n\n是你在幕后维护着这一切，就和我当年在女王法庭上所做的一样。\n\n<瓦丝琪女男爵的目光似乎穿过了你。>\n\n你所做的绝非易事。', 37474),
(202361, 'zhCN', '格里恩！欢迎来到万世档案所，在这里汇集的大量心能可让我们提升你的能力。\n\n接受我的强化可使你获得以下能力：\n\n|TInterface\\ICONS\\Achievement_Raid_Thunder_King.blp:20|t|cFFFF0000|Hspell:335576|h[晋升者的向导]|h|r：当生命值高于90%时，你的伤害性法术和技能有一定几率对目标施放收集标记，持续对其造成伤害。在此期间击败一名敌人将收集其心能，为你提供护盾，持续一小段时间。', '格里恩！欢迎来到万世档案所，在这里汇集的大量心能可让我们提升你的能力。\n\n接受我的强化可使你获得以下能力：\n\n|TInterface\\ICONS\\Achievement_Raid_Thunder_King.blp:20|t|cFFFF0000|Hspell:335576|h[晋升者的向导]|h|r：当生命值高于90%时，你的伤害性法术和技能有一定几率对目标施放收集标记，持续对其造成伤害。在此期间击败一名敌人将收集其心能，为你提供护盾，持续一小段时间。', 37474),
(199451, 'zhCN', '', '哈……还记得那次是和织梦者一起……', 37474),
(183994, 'zhCN', '', '往左一点！', 37474),
(183995, 'zhCN', '', '左！右！你的右边！', 37474),
(183993, 'zhCN', '你摸得着上面吗？', '', 37474),
(204708, 'zhCN', '死掉的布兰契顺从地抬起了蹄子，她很乐意让受伤的蹄子得到照护。她呼吸急促，猛烈地吐着气，似乎非常口渴。', '', 37474),
(204686, 'zhCN', '毛梳除去了死掉的布兰契皮肤上的刺激物，她哆嗦了几下，用鼻子轻柔地顶着你。她调整了一下重心，跺了跺蹄子，你发现她的蹄子裂开了大口子。', '', 37474),
(204663, 'zhCN', '死掉的布兰契热切地吞下了燕麦。虽然她披散着毛发，但她的皮肤上布满了虫虱叮咬、锋锐棘刺和恶臭的软泥。', '', 37474),
(204710, 'zhCN', '死掉的布兰契一动也不动，等着你将鞍毯放在她的身上。她的颤抖慢慢停止了。布兰契开始翻动你的包裹，寻找一份美餐。', '', 37474),
(204668, 'zhCN', '死掉的布兰契突然停了下来，以避免撞倒你。', '', 37474),
(204903, 'zhCN', '死掉的布兰契眼神迷乱，她的体态憔悴不堪，她显然饿坏了，急需一顿丰盛的美餐。', '', 37474),
(121956, 'zhCN', '我，马迪亚斯·肖尔大师，在此授权深红之剑追杀叛逃探员安玻·吉尔妮。', '', 37474),
(204709, 'zhCN', '死掉的布兰契急迫地喝下了一整桶水，随后才抬起头看着你。她虽然不再口渴，却仍无法控制地打着哆嗦。', '', 37474),
(54130, 'zhCN', '', '利尔……伤得很重。$b$b<密探吉尔妮用力地捶了地面一拳。>$b$b他快死了，$n！可我们对此却无能为力！', 37474),
(204749, 'zhCN', '死掉的布兰契闻到了苹果的气息，鼻孔立刻张开了。她饥渴地咽下了苹果，满足地鸣叫着，将头靠在你的肩膀上。', '', 37474),
(121283, 'zhCN', '安玻·吉尔妮曾是我们的战友……不敢相信，我们居然要来暗杀她。', '', 37474),
(197546, 'zhCN', '', '够了！你那“舞姿”是在抽筋吗？', 37474),
(207303, 'zhCN', '有你帮助我们保卫森林真是太好了，$G猎手:女猎手;。', '有你帮助我们保卫森林真是太好了，$G猎手:女猎手;。', 37474),
(189107, 'zhCN', '虽然我们急需优秀的施法者，但我们可不会降低门槛。', '', 37474);
INSERT INTO `faction_locale` (`ID`, `locale`, `Name_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(2463, 'zhCN', '玛拉斯缪斯', '玛拉斯缪斯是个长得像蘑菇的炽蓝仙野居民，古老得难以想象。他是这个国度的生态系统的有机组成部分。你扶助森林的意愿软化了他身体里最像是心的构造，而这里总有很多的活儿等着完成。', 37474),
(2410, 'zhCN', '不朽军团', '很久以前，兵主建立了玛卓克萨斯的五大密院，希望借此训练出最终极的战斗力。这支坚强的部队运用着力量、智慧和计谋，发誓守护暗影界，抵御一切威胁。', 37474),
(2465, 'zhCN', '荒猎团', '荒猎团在危急时刻受到了寒冬女王的召唤，他们召集了全炽蓝仙野最优秀的男女猎手。面对着心能枯竭和重重危险，荒猎团已经准备好守护这片森林。', 37474),
(2462, 'zhCN', '缝合大师', '缝合大师可以把血肉、骨头和心能熔铸到构造体里制作玛卓克萨斯的强大盟友，故而声名远播，他们退出了叛变的造物密院后，在屠夫区居住。', 37474),
(2464, 'zhCN', '魅夜王庭', '心能枯竭和德鲁斯特入侵占用了寒冬女王和荒猎团的大量注意力。现在只能依靠魅夜王庭的宗主来保护灵种，并保护林地。', 37474);
