INSERT INTO `mount_locale` (`ID`, `locale`, `Name_lang`, `SourceText_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(1309, 'zhCN', '啾鸣心蛛', '|cFFFFD200冒险：|r暗影界|n', '这些飞虫极其敏捷，一旦把它们训练好，让它们不会把骑乘者的心能吸得一干二净，就可以成为优秀的坐骑。', 37474),
(1420, 'zhCN', '幽影镰角虫', '|cFFFFD200商人出售：|r纺鼻|n|cFFFFD200地区：|r炽蓝仙野|n', '幽影戈姆是所有戈姆里最温顺的，但它们也长有最大的角和颌骨。它们如此温顺也可能是因为其他生物根本不敢惹它们。', 37474),
(1414, 'zhCN', '罪奔者布兰契', '|cFFFFD200NPC：|r死掉的布兰契|n|cFFFFD200地区：|r雷文德斯|n |n', '活着的时候，布兰契似乎是一匹深情而且乖巧的马儿，性情和胃口都很好。她一定是悄悄地犯下了邪恶的罪行，才让她与雷文德斯被诅咒的灵魂为伍。但她究竟做了什么呢？', 37474),
(1291, 'zhCN', '祥韵，天佑金犊', '|cFFFFD200游戏商城|r|n', '熊猫人相信，只要用手摩挲这只公牛闪亮的毛皮，就能获得好运，但前提是要能捉得到它。', 37474),
(1424, 'zhCN', '雪暴', '|cFFFFD200暴雪三十周年|r', '他长途跋涉，来自寒冰与雪霜，迎接着艾泽拉斯冒险者的朝阳。', 37474);
INSERT INTO `lfg_dungeons_locale` (`ID`, `locale`, `Name_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(2047, 'zhCN', '玛卓克萨斯', '', 37474),
(2092, 'zhCN', '石中殷红', '德纳修斯的顽石军团干将正在等待，他们已经布下了圈套，足以一劳永逸地消灭起义军。', 37474),
(2090, 'zhCN', '汲心宝库', '心能从纳斯利亚堡的宝库中不断流出，就像伤口一般。如果不终止的话，雷文德斯会被彻底吸干。', 37474),
(2096, 'zhCN', '谒见傲慢', '德纳修斯在他的高塔中急切地等待着英雄们的到来，这场对决会决定雷文德斯的命运。', 37474),
(2091, 'zhCN', '丰饶圣物所', '贵族们陶醉在胜利中，而英雄们必须破坏他们的聚会，推翻他们的权位。', 37474),
