INSERT INTO `mail_template_locale` (`ID`, `locale`, `Body_lang`, `VerifiedBuild`) VALUES
(568, 'zhCN', '致$p，\n\n你在之前的信件中报告了猎物的数量，我不会质疑它的精确性。\n\n但是这个数字也太高了。我想你作为噬渊行者……\n\n但我依然很享受狩猎竞赛，我也会尽量追上你。\n\n自我收到你的上一封信以来，我已经完成了138次猎杀，并且……\n\n<狩猎队长柯莱恩的字体越来越小。>\n\n现在是152次！最后一波里有几个只是小虫子，但你已经领先了那么多，我当然不能挑三拣四了！\n\n再接再厉，\n狩猎队长柯莱恩', 37474);
INSERT INTO `chr_classes_locale` (`ID`, `locale`, `Name_lang`, `NameMale_lang`, `NameFemale_lang`, `Description_lang`, `RoleInfoString_lang`, `DisabledString_lang`, `HyphenatedNameMale_lang`, `HyphenatedNameFemale_lang`, `VerifiedBuild`) VALUES
(3, 'zhCN', '猎人', '猎人', '猎人', '猎人对于世界上的每个角落都了如指掌，他们和野兽有着与生俱来的亲密关系。猎人依靠武器和宠物制造伤害。', '职责：|cffffffff远程或近战伤害输出|r', '要选择该职业，你必须更换一个种族。', '猎人', '猎人', 37474),
(1, 'zhCN', '战士', '战士', '战士', '战士是身穿板甲的勇者，他们将钢铁武器的效用发挥到了极致。在战斗当中，战士会产生怒气值，并利用怒气值来发起特殊的攻击。', '职责：|cffffffff坦克/近战伤害输出|r', '要选择该职业，你必须更换一个种族。', '战士', '战士', 37474),
(11, 'zhCN', '德鲁伊', '德鲁伊', '德鲁伊', '变形者德鲁伊对大自然的植物和动物有着特殊的关爱。德鲁伊可专精于治疗、远程施法，或者变身为猎豹或熊来进行近身格斗。', '职责：|cffffffff坦克/治疗者/远程伤害输出/近战伤害输出|r', '要选择该职业，你必须更换一个种族。', '德鲁伊', '德鲁伊', 37474),
(5, 'zhCN', '牧师', '牧师', '牧师', '牧师是有着多种治疗手段的全能型治疗者。但也可以牺牲自己的治疗能力，转而给敌人造成暗影伤害。', '职责：|cffffffff治疗者/远程伤害输出|r', '要选择该职业，你必须更换一个种族。', '牧师', '牧师', 37474),
(8, 'zhCN', '法师', '法师', '法师', '法师是艾泽拉斯最有代表性的魔法使用者。他们通过专注的学习与钻研完善自身的魔法技艺。法师只能穿着布制衣甲，但他们强大的攻击和防御性法术完全能弥补装甲的不足。', '角色：|cffffffff远程伤害输出|r', '要选择该职业，你必须更换一个种族。', '法师', '法师', 37474),
(7, 'zhCN', '萨满祭司', '萨满祭司', '萨满祭司', '萨满祭司用四大元素的力量对他们的武器和法术进行强化。对于萨满祭司而言，最重要的莫过于他们的图腾。在战斗中，萨满祭司会召唤出这些小东西，进行治疗，削弱或伤害敌人。', '职责：|cffffffff治疗者/远程伤害输出/近战伤害输出|r', '要选择该职业，你必须更换一个种族。', '萨满祭司', '萨满祭司', 37474),
(12, 'zhCN', '恶魔猎手', '恶魔猎手', '恶魔猎手', '恶魔猎手是一种英雄职业，他们的初始等级较高。他们是使用禁忌的恶魔法术猎杀敌人的黑暗流亡者。', '职责：|cffffffff坦克/近战伤害输出|r', '需要拥有一个70级的角色。', '恶魔猎手', '恶魔猎手', 37474),
(9, 'zhCN', '术士', '术士', '术士', '术士擅于施放火焰或者暗影法术并造成伤害，还能吸血或施加诅咒。他们召唤恶魔充当仆从。', '角色：|cffffffff远程伤害输出|r', '要选择该职业，你必须更换一个种族。', '术士', '术士', 37474),
(4, 'zhCN', '潜行者', '潜行者', '潜行者', '潜行者在团队中经常充当刺客或侦察兵的角色，但也有许多潜行者乐于做个独行侠。潜行者总能神不知鬼不觉的游走在敌人身旁，从身后对敌人发动突袭，迅速夺取敌人的生命。', '角色：|cffffffff近战伤害输出|r', '要选择该职业，你必须更换一个种族。', '潜行者', '潜行者', 37474);
